import React from 'react';
import Row from 'react-bootstrap/Row';
import Col from 'react-bootstrap/Col';

const Roles = ({name, type, description, postdate}) => {

    return (
        <Row className="card">
            <h1>{ name }</h1>
            <h2>{ type }</h2>
            <p>{ description }</p>
            <p>{ new Date(postdate).toLocaleString() }</p>
        </Row>
    );
}

export default Roles;
